import React from 'react';
import { Container, ListGroup } from 'react-bootstrap';
import './CSS/Kapcsolat.css';

const Kapcsolat = () => {
  return (
    <Container className='Kapcsolat'>
      <h2>Elérhetőség</h2>
      <p>Ha kérdése van, vagy segítségre van szüksége, lépjen kapcsolatba velünk:</p>
      <ListGroup>
        <ListGroup.Item>Email: pelda@etelrendeles.hu</ListGroup.Item>
        <ListGroup.Item>Telefon: +36 1 234 5678</ListGroup.Item>
        <ListGroup.Item>Cím: 1234 Budapest, Pelda utca 5.</ListGroup.Item>
      </ListGroup>
    </Container>
  )
}

export default Kapcsolat;
